#[inline]
pub fn is_hex_digit(chr: u8) -> bool{
  (chr >= 0x30 && chr <= 0x39) || (chr >= 0x41 && chr <= 0x46) || (chr >= 0x61 && chr <= 0x66)
}

character::is_newline:
